app.get("/movielist", function(req, res) {
    let ans = arr1.slice(); // Create a copy of the array to avoid modifying the original array
    let languages = req.query.languages;
    let genres = req.query.genres;
    let format = req.query.format;
  
    if (languages) {
      let languageArr = languages.split(',').map(lang => lang.trim().toLowerCase());
      ans = ans.filter(p => {
        return p.languages.some(e => languageArr.includes(e.toLowerCase()));
      });
    }
  
    if (genres) {
      let genreArr = genres.split(',').map(genre => genre.trim().toLowerCase());
      ans = ans.filter(p => {
        return p.genres.some(e => genreArr.includes(e.toLowerCase()));
      });
    }
  
    if (format) {
      let formatArr = format.split(',').map(f => f.trim().toLowerCase());
      ans = ans.filter(p => {
        return p.format.some(e => formatArr.includes(e.toLowerCase()));
      });
    }
  
    console.log(ans.length);
    res.send(ans);
  });
  

